        var row = 0,column = 0
        s.helper74(1, 2, 1, &row, &column)
        XCTAssertEqual(1, row)
        XCTAssertEqual(0, column)
        s.helper74(4, 3, 4, &row, &column)
        XCTAssertEqual(1, row)
        XCTAssertEqual(0, column)
    }
